// Token CLAP
    address public token_addr = 0xFf00811B621F8253792e794126a899689c93CDB3;
    IERC20 acceptedToken;


    NFTCups acceptedCups;
    address public cups_addr = 0x942583b85A86355D5B2717fd51A801e903959640;
    NFTDice acceptedDice;
    address public dice_addr = 0x6D726d8866f513Fc39B40CfC7B251E4E5D4f40c3;

    
    address public manager;
    address public addressForPool = 0x8cad53767553A1f15d3F672e3C9c10eEcF4C867F;

    uint256 private reward = 10;

    mapping(address => uint256) public _addressCash;


