        uint8 index = uint8(uint256(keccak256(abi.encodePacked(randomN, block.timestamp, nonce))) % 6);
        nonce++;
        return index;
    }
    

    function getClaim(address addr) public view returns (uint256) {
        return _addressCash[addr];
    }

    function claimear(address addr) public {
        require(msg.sender == addr, "This is not your address!");
