    function rolldice(uint256 tokenCup, uint256[] memory tokensDice) external {
        require(acceptedCups.getTokenDetails(tokenCup).rare >= tokensDice.length, "A lot of dice");
        require(block.timestamp >= acceptedCups.getTokenDetails(tokenCup).endCooldown, "You can't play with cup not yet for play!");
        
        uint8 number = _random()+1;
        uint8 coincidence = 0;
        for (uint i = 0; i < tokensDice.length; i++) {
            require(block.timestamp >= acceptedDice.getTokenDetails(tokensDice[i]).endCooldown, "You can't play with dice not yet for roll!");
